This contract holds the core logic for multicall. Each DAO gets its own Multicall Instance (MI) contract to use. The contract consists of three main features: The main method in this contract is: multicall ( calls: BatchCall[][] ) It executes a bunch of BatchCall arrays. Each BatchCall has information for making a batch of function-calls: a target address and an array on function-calls to execute on that target. Each function-call has a function name, arguments encoded in base64, gas to use (u64 encoded as string) and amount of yoctoNEAR attached deposit (u128 encoded as string). Batches inside one array run one after another, as a promise chain. Different arrays of batches run in parallel. Example: calls = [ [ Batch_11, Batch_12, Batch_13 ], [ Batch_21, Batch_22]
] In this example we have 2 arrays of batches. In the first one Batch_12 waits for Batch_11 and Batch_13 waits for Batch_12. In the second array Batch_22 waits for Batch_21. Both arrays start executing in the same block and are independent of each other. Permissioned interactions with the contract through whitelisting of addresses: Due to the async nature of Near, funds can sit in the contract during multiple blocks awaiting the execution of cross-contract calls. To prevent stealing of funds, we require an address to be whitelisted before calling one of the contract's critical methods. there are two main whitelists: admins whitelist holds addresses that can interact with the contract, they can add or remove others from the whitelist. tokens whitelist holds token addresses that can be attached to function calls, as the contract implements ft_on_transfer. The contract's address is whitelisted by default, this allows nesting multiple contract methods for convenience. Jobs : Multicall executions can be scheduled to run at a certain time in the future, made possible by integrating croncat . Anyone can register a job on the multicall contract, but an admin has to approve it. Admins can pause/resume job executions and also edit a job's multicall arguments. The following must be specified when creating a job: function job_add ( job_multicalls: MulticallArgs[], job_cadence: string, // cron expression job_trigger_gas: u64, job_total_budget: u128, job_start_at: u64 = context.blockTimestamp
): u32
